import React from "react";
import Login from "./components/Login";
import Main from "./components/Main";

class App extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			user: {
				// id: 1234,
				// name: "Brett van Beynum"
			}
		};
	}

	render() {

		let defaultPage;
		if (this.state.user.id) {
			defaultPage = <Main />;
		}
		else {
			defaultPage = <Login />;
		}

		return defaultPage;

	}

}

export default App;
